import React from "react";
import "./App.css";

import { AppHeader } from "./view/AppHeader";
import { AppBody } from "./view/AppBody";
import { AppContainer } from "./state";

function App() {
  return (
    <AppContainer>
      {({ mediaSelected, onMediaChange, watch, listen }) => {
        <div className="App">
          <AppHeader />
          <AppBody
            mediaSelected={mediaSelected}
            onMediaChange={onMediaChange}
            watch={watch}
            listen={listen}
          />
        </div>;
      }}
    </AppContainer>
  );
}

export default App;
